                    <p class="text-center">Center aligned text on all viewport sizes.</p>
                    </tr>
                </thead>
            </table>*/

            <table className="table">
                <tbody>
                    <tr>
                        <td>Mark</td>
                        <td>Otto</td>
                        <td>@mdo</td>
                    </tr>
                </tbody>
            </table>

